import './App.css';
import { getApi } from './services/api';

const datas = async () => {
  const data = await getApi();
return data;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <h1>Componente APP</h1>
       <p>{JSON.stringify(this.datas())}</p>
      </header>
    </div>
  );
}

export default App;
